});

cy.request({
    method: "PATCH",
    headers: {
        Authorization: "Bearer " + access_token,
    },
    url: "/api/v1/contacts/2",
    body: {
        firstName: "Regression",
        lastName: "Results",
    },
}).then(function (response) {
    expect(response.status).equal(200);
    expect(response).property("body").to.contain({
        firstName: "Regression",
        lastName: "Results",
        id: 2,
    });
});

